import React from 'react'
// import PropTypes from 'prop-types'
import { useParams} from "react-router-dom";

const News = props => {
    let { year, month, day, name } = useParams();

    return (
        <div>
            <div className="containerX">
                <div className="row">
                    <div className="col-xs-12 col-md-8 col-lg-7"></div>
                </div>
            </div>
            <h2>{year}/{month}/{day}/{name}</h2>
            <p></p>
        </div>
    )
}

News.propTypes = {

}

export default News
